import React from "react";
import{Icon} from "../images/share";

export const SuggestedSource = () => {
  return (
    <div className="wrapper wrapper-source">
      <p>Suggested Sources</p>
      <div className="followers">
        <Icon />
        <p>Deep Learning</p>
        <p>100 followers </p>
      </div>
      <p>Find more</p>
    </div>
  );
};
